package org.openapitools.server.model


/**
 * Breakdown of tokens used in a completion.
 *
 * @param acceptedPredictionTokens When using Predicted Outputs, the number of tokens in the prediction that appeared in the completion.  for example: ''null''
 * @param audioTokens Audio input tokens generated by the model. for example: ''null''
 * @param reasoningTokens Tokens generated by the model for reasoning. for example: ''null''
 * @param rejectedPredictionTokens When using Predicted Outputs, the number of tokens in the prediction that did not appear in the completion. However, like reasoning tokens, these tokens are still counted in the total completion tokens for purposes of billing, output, and context window limits.  for example: ''null''
*/
final case class CompletionUsageCompletionTokensDetails (
  acceptedPredictionTokens: Option[Int] = None,
  audioTokens: Option[Int] = None,
  reasoningTokens: Option[Int] = None,
  rejectedPredictionTokens: Option[Int] = None
)

